import React from "react";

import CreateButton from "./CreateButton";

export default class Blueprint extends React.Component {
    constructor() {
        super();
        this.state = { blueprints: [] };
    }

    componentDidMount() {
        //Here goes an ajax call to server for all existing blueprints.
        //Hardcoded some blueprints below.
        this.setState({
            blueprints: {
                name: "water",
                comment: "",
                commands: [],
                sensors: [
                    {
                        name: "biological",
                        sensor_id: "biological",
                        data_type: "double"
                    },
                    {
                        name: "physical",
                        sensor_id: "physical",
                        data_type: "integer"
                    }
                ],
                attributes: [{ location: "details about location" }]
            }
        });
    }

    render() {
        console.log("Blueprint Component state -> ", this.state);
        return <CreateButton />;
    }
}
